pre_proc_tweet:
emmeline pankhurst is the woman of the day;
although she wasn’t perfect, she demanded equality for woman as the leader of the suffragette movement. her effos led to the vote being granted to some women (those over the age of 30 who owned propey or were married to a man who owned propey) in 1918.
underestimate the power of a fearless woman at your peril – suffragettes threw themselves under horses, chained themselves to railings and starved themselves for the right to vote.

